import logo from './logo.svg';
import './App.css';
import { Landing } from "./components/Landing";
import { Card, CardContent } from "@mui/material";

function App() {
  return (
    <div className="App">
      <Card style={{ color: "grey" }}>
        <CardContent>
          <Landing />
        </CardContent>
      </Card>
    </div>
  );
}

export default App;
